import React from "react";
// import "./HeaderArea.css";
import {FaYoutube} from 'react-icons/fa';
import {MdHome, MdSearch, MdVideoCall, MdViewComfy} from 'react-icons/md';
import {AiTwotoneBell} from 'react-icons/ai';
import { HiMicrophone } from "react-icons/hi";

function BottomNav() {
    return (
        <nav className="navbar navbar-expand-sm navbar-light bg-light text-dark fixed-bottom">
        <ul className="navbar-nav">
            <li className="nav-item text-center">
                <a className="nav-link" href="/"><MdHome color="blue" fontSize="1.5rem" /><br/><span style={{ fontSize:"0.8rem" }}>Home</span></a>
            </li>
            <li className="nav-item text-center">
                <a className="nav-link" href="/"><MdHome color="blue" fontSize="1.5rem" /><br/><span style={{ fontSize:"0.8rem" }}>Shorts</span></a>
            </li>
            <li className="nav-item text-center">
                <a className="nav-link" href="/"><MdHome color="blue" fontSize="1.5rem" /><br/><span style={{ fontSize:"0.8rem" }}>Notification</span></a>
            </li>
        </ul>
    </nav>
    );

}


export default BottomNav;
